import React from "react";
import Avatar from '@mui/material/Avatar';
import Container from '@mui/material/Container';
import SpaIcon from '@mui/icons-material/Spa';
import { AppBar, Button, ButtonGroup, Box} from "@mui/material";
import { green} from '@mui/material/colors';

export default function Navbar({ conBoton, color, funcionLogin }) {
    return (
        <AppBar position="static">
            <Container alignItems="center">
                <Box
                    display="flex"
                    justifyContent="center"
                    alignItems="center"
                    minHeight="10vh"
                >
                    <Avatar sx={{ bgcolor: green[600] }}><SpaIcon /></Avatar>
                    <ButtonGroup variant="contained" aria-label="outlined primary button group">
                        <Button><a href="https://plantasacuaticas.com.ar/paginas/plantas.html">Plantas</a></Button>
                        <Button><a href="https://plantasacuaticas.com.ar/paginas/tienda.html">Tienda</a></Button>
                        <Button><a href="https://plantasacuaticas.com.ar/paginas/formulario.html">Contacto</a></Button>
                    </ButtonGroup>
                </Box>
            </Container>
        </AppBar>


    );
}
